pragma solidity >=0.4.21 <0.7.0;
pragma experimental ABIEncoderV2;

contract MarketPlaceFactory {

    uint nbHouseAllowed = 3;
    uint countHouses = 0;

    // Caractéristiques d'une maison
    struct House {
        uint idHome;
        uint price;
        bytes32 addressHome; //bit32
        uint squareMeter;
        bytes32 description;
        uint hashDocuments;
        bytes32 publicAddressSolder;
        bool forSale;
        //others elements
    }

    House[] public houses;
    address[] owners;

    address houseOwner;
    address houseBuyer;

    mapping (address => uint) public ownerToHouse;
    mapping (address => uint) ownerHouseCount;

    //vérifier si une maison appartient bien au bon propriétaire
    modifier onlyOwner() {
        require(msg.sender == houseOwner);
        _;
    }

    // modifier canCreateHouse(uint _idHome) {
    //     ownerHouseCount[msg.sender]++;
    //     countHouses++;
    //     _;
    // }

    // créer des maisons
    function createHouse(
        uint _id, uint _price, bytes32 _addressHome, uint _squareMeter, bytes32 _description, uint _hashDocuments, bytes32 _publicAddressSolder
    ) public {
        House memory newHouse = House(_id, _price, _addressHome, _squareMeter, _description, _hashDocuments, _publicAddressSolder, false);
        houses.push(newHouse);
        ownerToHouse[msg.sender] = houses.length;
        countHouses++;
        owners.push(msg.sender);
    }

    // Vérifie si la maison est bien dans la liste des maisons à vendre
    function checkHouseForSale(uint _idHome) private view returns (bool) {
        for(uint i = 0; i < owners.length; i++) {
            if (ownerToHouse[owners[i]] == _idHome) {
                return true;
            }
        }
        return false;
    }

    function checkPriceHouse() private view returns (bool) {
        //require();
        return true;
    }


    function removeAtIndex(uint index) public {
        if (index >= houses.length) return;

        for (uint i = index; i < houses.length-1; i++) {
        houses[i] = houses[i+1];
        }

        delete houses[houses.length-1];
        //houses.length--;
    }

    // function ACHAT d'une maison
    function buyingHouse(uint _idHome, address payable _addressBuyer) public payable {
        // checker si la maison est en vente, si le montant est correct
        if(checkHouseForSale(_idHome) && checkPriceHouse()) {
            // transfer ethers
            _addressBuyer.transfer(houses[_idHome].price);
            // transfert de propriété: obtenir la maison du vendeur et mettre l'addresse de l'acheteur
            ownerToHouse[_addressBuyer] = _idHome;
            // enlever la maison de la liste de ventes
            removeAtIndex(_idHome);
        }
    }

    function getAllHousesWithDetails() public view returns(House[] memory) {
        return houses;
    }

    function getHouse(uint _idHouse) public returns (House memory) {
        return houses[_idHouse];
    }

    function houseForSale(uint _idHouse) public {
        House memory houseForSale = getHouse(_idHouse);
        houseForSale.forSale = true;
    }

    // TESTS
    // createHouse
    // mettre en vente
    // achat
}
